 ('2', '2', 'en_us', 'Home', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Duraedge.web will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, '0', NULL, NULL, NULL, NULL, 'YO', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Headline', 'subheadline', 'CTA', '0', NULL, NULL, NULL, '2017-09-05 17:18:02', '2017-12-15 21:19:10', 'cd4cfc85-0e1c-4d12-a2da-c3e46025f5fc'),
